	ctx.save();
	ctx.transform(1,0,0,1,6.5,3.95);

	var frame_cnt = 1;
	frame = frame % frame_cnt;
	switch(frame){

var frame = -1;
var time = 0;
var frames = [];
frames.push(0);

var backgroundColor = "#e5c9b5";
var originalWidth = 610;
var originalHeight= 406;
function nextFrame(ctx,ctrans){
	var oldframe = frame;
	frame = (frame+1)%frames.length;
	if(frame==oldframe){time++;}else{time=0;};
	drawFrame();
}

function drawFrame(){
	ctx.fillStyle = backgroundColor;
	ctx.fillRect(0,0,canvas.width,canvas.height);
	ctx.save();
	ctx.transform(canvas.width/originalWidth,0,0,canvas.height/originalHeight,0,0);
	sprite62(ctx,ctrans,frames[frame],0,time);
	ctx.restore();
}

window.setInterval(function(){nextFrame(ctx,ctrans);},40);
